import { Component } from '@angular/core';
import { Route } from '@angular/router';

@Component({
  selector: 'app-tabs',
  templateUrl: './tabs.component.html',
  styleUrls: ['./tabs.component.scss'],
})
export class TabsComponent {
  constructor(private route:Route){}
  changeBookmarks() {
    this.route.na
  }
}
